import React, { Component } from 'react';
class Counter extends Component {
    render() {
        return (
            <div>
                <button onClick={increment}>+10</button>
                <span >0</span>
            </div >
        )
    }

    increment() {
        console.log('Increment clicked');
    }
}



export default Counter;
